id:
A JSON `STRUCTURE` for configuring static website hosting.
	Example:
	{
		"ErrorDocument": {
			"Key": "error.html"
		},
		"IndexDocument": {
			"Suffix": "index.html"
		},
		"RoutingRules": [
			{
				"Condition": {
					...
				},
				"Redirect": {
					...
				}
			}
		]
	}

