id:
A `STRUCTURE` using JSON syntax.
	Example:
	{
		"Rules": [
			{
				"Status": "Enabled",
				"Priority": 1,
				"Filter": {
					"Prefix": ""
				},
				"DeleteMarkerReplication": {
					"Status": "Disabled"
				},
				"Destination": {
					"Bucket": "DEST-BUCKET-NAME"
				}
			}
		]
	}

